function Home(){
 return (
    <div>
    <Navbar />
    <div>  <img className="home_img" src={img} alt="impage" />
    <h1 className="head_home">The BITS HYDERABAD CONSULTING GROUP</h1></div>
    </div>
 );

}
export default Home;
